const url = process.env.REACT_APP_PUBLIC_URL

export default function Img(props){
    return(
        <>
            <img src={url + props.src} alt={props.alt} className={props.className}/>
            <FontAwesomeIcon icon={["fal", "coffee"]} />
        </>
    );
}
